import React, { Component } from "react";
import PrettyHome from './homeStyles';
import Product from '../product/product';
import { Link } from "react-router-dom";
import ProductListing from '../../components/productListing/productListing';

class Home extends Component {
    state = {
        auctionId: 1,
        auctionId2: 2
    }

    componentDidMount = () => {
        this.showProducts();
    }

    showProducts = () => {
        const numArray = [1, 2, 3, 4, 5];
        const numArrayMapped = numArray.map( (num) => {
            return <h2 key={num}>Yo: {num}</h2>
        })
        return <div>{numArrayMapped}</div>
    }

    render() {
        return (
            <div>
                <PrettyHome>
                    hello world this is the home page
                    <br></br>
                    <Link className='logo' to={`/product/${this.state.auctionId}`} component={Product}>/product/:auctionId 1</Link>
                    <br></br>
                    <Link className='logo' to={`/product/${this.state.auctionId2}`} component={Product}>/product/:auctionId 2</Link>
                    <ProductListing
                        auctionId='1'
                        imgLink='https://diy.sndimg.com/content/dam/images/diy/fullset/2011/7/26/1/iStock-10761186_halloween-pumpkin-in-garden_s4x3.jpg.rend.hgtvcom.966.725.suffix/1420851319631.jpeg'
                        title='My title'
                        description='my descrip'
                        gender='my gend'
                        category='my cat'
                        startingPrice='my startingPrice'
                        minBidIncrement='my min bid'
                    />
                    {this.showProducts()}
                </PrettyHome>
            </div>

        )
    }
}

export default Home;
